Do a conditional $lookup depending of a value in MongoDB?<p>I have three collections in MongoDB 4.0 (pymongo)</p>
<pre><code>users: [
{name: &quot;John&quot;, user_type: &quot;client&quot;, society: 1},
{name: &quot;Charles&quot;, user_type: &quot;client&quot;, society: 1},
{name: &quot;Jessy&quot;, user_type: &quot;provider&quot;, society: 1},
{name: &quot;Tim&quot;, user_type: &quot;provider&quot;, society: 2}
]

clients: [
{_id: 1, name: &quot;Client1&quot;}
]

providers: [
{_id: 1, name: &quot;Provider1&quot;},
{_id: 2, name: &quot;Provider2&quot;}
]
</code></pre>
<p>I need to do a join between users and clients or providers depending on <code>user_type</code> value and set it in the same key value in the result.</p>
<p>For example, the result will be :</p>
<pre><code>user : {name: &quot;John&quot;, user_type: &quot;client&quot;, society: 1, complete_society: {_id: 1, name: &quot;Client1&quot;}}

or

user : {name: &quot;Tim&quot;, user_type: &quot;provider&quot;, society: 2, complete_society: {_id: 2, name: &quot;Provider2&quot;}}
</code></pre>
<p>The only solution I have now is to do two different <code>$lookup</code> in two different key and then rework the result after the request</p>
<pre><code>db.users.aggregate([{                                   
  &quot;$lookup&quot;: {
    &quot;from&quot;: &quot;clients&quot;,
    &quot;localField&quot;: &quot;society&quot;,
    &quot;foreignField&quot;: &quot;_id&quot;,
    &quot;as&quot;: &quot;client&quot;
  }
},
{&quot;$unwind&quot;: &quot;$clients&quot;},{                                   
  &quot;$lookup&quot;: {
    &quot;from&quot;: &quot;providers&quot;,
    &quot;localField&quot;: &quot;society&quot;,
    &quot;foreignField&quot;: &quot;_id&quot;,
    &quot;as&quot;: &quot;provider&quot;
  }
},
{&quot;$unwind&quot;: &quot;$providers&quot;}]);
</code></pre>
<p>And then do a forEach and set a key <code>complete_society</code> and delete previous keys. It's not the perfect way and maybe in mongo, something exists to do that.</p>

